MongoDB Bulk Insert Operation instead of For-Loop<p>Let's consider a social network to be built by <code>NodeJS</code> and <code>MongoDB</code>.<br>
So, if a user creates a new post, it should be saved to his/her followers feed.</p>

<p>The straightforward implementation of this operation as follow (simplified):</p>

<pre><code>var newPost="New Post";
//get list of followers of user 1
var listOfFollowers = followersCollection.find({u:"1"}); 

for(var i=0;i&lt;listOfFollowers.length;i++){
    var followerId = listOfFollowers[i]._id;
    //insert new post of user 1 to every follower feed
    feedsCollection.insertOne(
       {ownerId:followerId,authorId:"1",content:newPost}
    ); 
}
</code></pre>

<p>This, of course, has very bad performance in case of big numbers in followers count. How can do this with a single fast performing MongoDB query?</p>

